import React, { useState } from 'react';
import { useLocation } from 'react-router-dom';
import {
 Collapse,
 Navbar,
 NavbarToggler,
 NavbarBrand,
 Nav,
 NavItem,
 NavLink,
} from 'reactstrap';
import { BrowserRouter, Route, Routes, Link } from 'react-router-dom';
import Home from './Components/Home';
import Booklet from './Components/Booklet';
import Doctor from './Components/Doctor';
import Roster from './Components/Roster';
import Login from './Login';
import axios from 'axios';

axios.defaults.xsrfCookieName = 'csrftoken';
axios.defaults.xsrtHeaderName = 'X-CSRFToken';
axios.defaults.withCredentials = true;

const client = axios.create({
 baseURL: "http://127.0.0.1:8000"
});

function App() {
 const [isOpen, setIsOpen] = useState(false);
 const toggle = () => setIsOpen(!isOpen);
 const location = useLocation();

 return (
  <BrowserRouter>
    <div>
      {location.pathname.startsWith('/components') &&
        <Navbar color="dark" dark expand="sm">
          <NavbarBrand href="/home">CUET Medical Center - Admin</NavbarBrand>
          <NavbarToggler onClick={toggle} />
          <Collapse isOpen={isOpen} navbar>
            <Nav style={{width: "100%", justifyContent: "flex-end"}} navbar>
             <NavItem style={{paddingRight: "10px"}}>
               <NavLink tag={Link} to="/admin/home" className="btn btn-light btn-outline-primary">
                 Home
               </NavLink>
             </NavItem>
              <NavItem style={{paddingRight: "10px"}}>
                <NavLink tag={Link} to="/admin/booklet" className="btn btn-light btn-outline-primary">
                 Booklet
                </NavLink>
              </NavItem>
              <NavItem style={{paddingRight: "10px"}}>
                <NavLink tag={Link} to="/admin/doctor" className="btn btn-light btn-outline-primary">
                 Doctor
                </NavLink>
              </NavItem>
              <NavItem style={{paddingRight: "10px"}}>
                <NavLink tag={Link} to="/admin/roster" className="btn btn-light btn-outline-primary">
                 Roster
                </NavLink>
              </NavItem>
              <NavItem>
                <NavLink tag={Link} to="/admin/roster" className="btn btn-light btn-outline-primary">
                 Logout
                </NavLink>
              </NavItem>
              </Nav>
            </Collapse>
          </Navbar>
        }

        {location.pathname.startsWith('/stcomponents') &&
          <Navbar color="dark" dark expand="sm">
            <NavbarBrand href="/home">CUET Medical Center</NavbarBrand>
            <NavbarToggler onClick={toggle} />
            <Collapse isOpen={isOpen} navbar>
              <Nav style={{width: "100%", justifyContent: "flex-end"}} navbar>
               <NavItem style={{paddingRight: "10px"}}>
                 <NavLink tag={Link} to="/student/home" className="btn btn-light btn-outline-primary">
                   Home
                 </NavLink>
               </NavItem>
               {/* Add other student routes here */}
              </Nav>
            </Collapse>
          </Navbar>
        }
        <Routes>
          <Route path='/admin/home' element={<Home />} />
          <Route path='/admin/booklet' element={<Booklet />} />
          <Route path='/components/doctor' element={<Doctor />} />
          <Route path='/components/roster' element={<Roster />} />
          <Route path='/student' element={<Home />} />
          <Route path='/student/booklet' element={<Booklet />} />
          <Route path='/student/doctor' element={<Doctor />} />
          <Route path='/student/roster' element={<Roster />} />
          <Route path='/' element={<Login />} />
        </Routes>
      </div>
    </BrowserRouter>
 );
}

export default App;
